        public static GaNumKVector VectorKVectorOp(this GaNumKVector vector, GaNumKVector kVector)
        {
            if (vector.GaSpaceDimension != kVector.GaSpaceDimension)
                throw new GaNumericsException("Multivector size mismatch");

            if (vector.Grade != 1)
                throw new InvalidOperationException();

            var vSpaceDim = kVector.VSpaceDimension;
            var grade = kVector.Grade;

            if (vSpaceDim == 2)
            {
                if (grade == 0)
                    return vector;

                if (grade == 1)
                    return VectorKVectorOp_2_1(vector, kVector);
            }

            if (vSpaceDim == 3)
            {
                if (grade == 0)
                    return vector;

                if (grade == 1)
                    return VectorKVectorOp_3_1(vector, kVector);

                if (grade == 2)
                    return VectorKVectorOp_3_2(vector, kVector);
            }

            if (vSpaceDim == 4)
