                if (grade == 1)
                    return VectorKVectorOp_6_1(vector, kVector);

                if (grade == 2)
                    return VectorKVectorOp_6_2(vector, kVector);

                if (grade == 3)
                    return VectorKVectorOp_6_3(vector, kVector);

                if (grade == 4)
                    return VectorKVectorOp_6_4(vector, kVector);

                if (grade == 5)
                    return VectorKVectorOp_6_5(vector, kVector);
            }

            if (vSpaceDim == 7)
            {
                if (grade == 0)
                    return vector;

                if (grade == 1)
                    return VectorKVectorOp_7_1(vector, kVector);

                if (grade == 2)
                    return VectorKVectorOp_7_2(vector, kVector);

                if (grade == 3)
                    return VectorKVectorOp_7_3(vector, kVector);

                if (grade == 4)
                    return VectorKVectorOp_7_4(vector, kVector);

                if (grade == 5)
