                if (grade == 3)
                    return VectorKVectorOp_8_3(vector, kVector);

                if (grade == 4)
                    return VectorKVectorOp_8_4(vector, kVector);

                if (grade == 5)
                    return VectorKVectorOp_8_5(vector, kVector);

                if (grade == 6)
                    return VectorKVectorOp_8_6(vector, kVector);

                if (grade == 7)
