        private static GaNumKVector VectorKVectorOp_2_1(GaNumKVector vector, GaNumKVector kVector)
        {
            var vectorArray = vector.ScalarValuesArray;
            var kVectorArray = kVector.ScalarValuesArray;
            var resultArray = new double[1];

            var value = 0.0d;
            value += vectorArray[0] * kVectorArray[1];
            value -= vectorArray[1] * kVectorArray[0];
            resultArray[0] = value;

            return GaNumKVector.Create(4, 2, resultArray);
        }

